export default {
  auth_info: (state, data) => {
    data.peerid && (state.auth_info.peerid = data.peerid)
    data.session_id && (stata.auth_info.session_id = data.auth_info.session_id)
    data.username && (stata.auth_info.username = data.auth_info.username)
  },
  user_info: (state, data) => {
    state.user_info.user_id = data.user_id
    state.user_info.username = data.username
  },
  menu: (state, data) => {
    state.menu = data
  },
  config_err_info: (state, data) => {
    state.config_err_info = data
  }
}
